import { createRouter, createWebHistory } from 'vue-router'
import MainSilde from '../views/main/MainSilde.vue'
import TableTopMenu from '@/views/menu/TableTopMenu.vue'

import ReceiptMenu from '@/views/receipt/ReceiptMenu.vue'


import CheckManager from '@/views/input/CheckManager.vue'
import Status from '@/views/status/Status.vue'


const routes = [
  {
    path: '/',
    name: '/',
    component:MainSilde
  },
  {
    path : '/tabletopmenu',
    name : '/tabletopmenu',
    component : TableTopMenu
  },
  {
    path : '/receiptmenu',
    name : '/receiptmenu',
    component : ReceiptMenu
  },
  {
    path : '/checkmanager',
    name : '/checkmanager',
    component : CheckManager
  },
  {
    path : '/status',
    name : '/status',
    component : Status
  }

]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
